import Card from "./Card";

export default function Cards(props) {
  const { characters } = props;
  const { onClose } = props;
  return (
    <div>
      {characters.map((character) => {
        <div >
          <Card character={character} onClose={onClose} />;
        </div>;
      })}
    </div>
  );
}
